import React from "react"

function Hello() {
    function nomeCompleto (n, sobre, nasc) {
      return (
        <div>
          <p>Nome: {n}.</p>
          <p>Sobrenome: {sobre}.</p>
          <p>Nome completo: {n} {sobre}.</p>
          <p>Idade: {2022 - nasc}.</p>
        </div>
      )
    }
    const nome = 'Jansen'
    const sobrenome = 'Lima'
    const nascimento = 1987
    return nomeCompleto(nome, sobrenome, nascimento)
}

setInterval(Hello, 1000);

